import React from 'react';
import FileViewer from 'react-file-viewer';

const FileViewerComponent = ({ base64File, fileType }) => {
  // Fungsi untuk menghapus prefix 'data:[<mediatype>];base64,' jika ada
  const removeBase64Prefix = (base64String) => {
    const regex = /^data:([A-Za-z-+/]+);base64,/;
    return base64String.replace(regex, '');  // Menghapus prefix jika ada
  };

  // Convert base64 string to a Blob
  const base64ToBlob = (base64, mimeType) => {
    base64 = 'data:application/pdf;base64,';
    const cleanedBase64 = removeBase64Prefix(base64);  // Bersihkan base64 dari prefix jika ada
    const byteCharacters = atob(cleanedBase64);  // Dekode base64 menjadi karakter
    const byteArrays = [];

    for (let offset = 0; offset < byteCharacters.length; offset += 1024) {
      const byteArray = new Uint8Array(Math.min(1024, byteCharacters.length - offset));
      for (let i = 0; i < byteArray.length; i++) {
        byteArray[i] = byteCharacters[offset + i].charCodeAt(0);
      }
      byteArrays.push(byteArray);
    }

    return new Blob(byteArrays, { type: mimeType });
  };

  // Tentukan MIME type berdasarkan jenis file
  const mimeTypes = {
    pdf: 'application/pdf',
    docx: 'application/vnd.openxmlformats-officedocument.wordprocessingml.document',
    xlsx: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet',
    png: 'image/png',
    jpg: 'image/jpeg',
    // Tambahkan tipe file lainnya sesuai kebutuhan
  };

  // Pastikan tipe file dan MIME type sesuai
  const mimeType = mimeTypes[fileType];
  if (!mimeType) {
    console.error(`MIME type untuk file ${fileType} tidak ditemukan!`);
    return <div>Invalid file type</div>;
  }

  const blob = base64ToBlob(base64File, mimeType);

  return (
    <div>
      <FileViewer
        fileType={fileType} // misalnya 'pdf', 'docx', 'xlsx'
        filePath={URL.createObjectURL(blob)} // Membuat URL dari Blob
      />
    </div>
  );
};

export default FileViewerComponent;
